Fornecimento e instalação de DockLight:
Comprimento aberto: 1,90 m; Comprimento fechado: 1,0m
LED: 50w Fornecedor sugerido: Niverlatec ou similar;

Fornecimento e instalação de Sensor de Doca: 
Semáforo: Três cores de alerta (vermelho/amarelo/verde) com lâmpada de LED; Sirene: Intermitentes de alarme sonoro com temporizador com 85dB; Sensores: Massa ou fotoelétrico; Botoeiras: Comando para operar manualmente as cores do semáforo; Kits de suporte para o sistema de sensores em aço galvanizado proteção IP 65;
Fornecedor sugerido: Niverlatec ou similar;
